export default function Index() {
  return (
    <motion.div 
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      exit={{ opacity: 0 }} 
      id="home-content" 
      className="content">
        HOME
    </motion.div> 
  )
}
